import React from 'react';
import { motion } from 'framer-motion';

const SkillCategory = ({ title, skills }) => (
  <motion.div
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    viewport={{ once: true }}
    className="bg-card rounded-lg p-4"
  >
    <h4 className="text-lg font-mono mb-3">{title}</h4>
    <div className="text-text-secondary text-sm">
      {skills.join(' ')}
    </div>
  </motion.div>
);

const FunFact = ({ children }) => (
  <motion.div
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    viewport={{ once: true }}
    className="bg-card rounded-lg p-4 text-text-secondary"
  >
    {children}
  </motion.div>
);

const About = () => {
  const skills = {
    Languages: ['TypeScript', 'Lua', 'Python', 'JavaScript'],
    Other: ['HTML', 'CSS', 'EJS', 'SCSS', 'REST', 'Jinja'],
    Tools: ['VSCode', 'Neovim', 'Linux', 'Figma', 'XFCE', 'Arch', 'Git', 'Font Awesome', 'KDE', 'fish'],
    Databases: ['SQLite', 'PostgreSQL', 'Mongo'],
    Frameworks: ['React', 'Vue', 'Disnake', 'Discord.js', 'Flask', 'Express.js']
  };

  const funFacts = [
    "I like winter more than summer",
    "I often bike with my friends",
    "I like pizza and pasta",
    "I was in Egypt, Poland and Turkey",
    "My favorite movie is The Green Mile",
    "I am still in school",
    "I don't have any siblings"
  ];

  return (
    <section id="about-me" className="py-20 px-6">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          className="mb-12"
        >
          <h2 className="section-title">about-me</h2>
          <h3 className="text-xl mb-6">Who am i?</h3>
          
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
            {/* About Text */}
            <div className="space-y-4 text-text-secondary">
              <p>
                Hello, i'm Elias!
              </p>
              <p>
                I'm a self-taught front-end developer based in Kyiv, Ukraine.
                I can develop responsive websites from scratch and raise them into modern user-friendly web experiences.
              </p>
              <p>
                Transforming my creativity and knowledge into websites has been my passion for over a year.
                I have been helping various clients to establish their presence online.
                I always strive to learn about the newest technologies and frameworks.
              </p>
            </div>

            {/* Image */}
            <div className="relative">
              <img
                src="/images/placeholder.svg"
                alt="Elias"
                className="w-full h-auto rounded-lg"
              />
              <div className="absolute -right-4 -bottom-4 grid grid-cols-4 gap-2">
                {[...Array(16)].map((_, i) => (
                  <div key={i} className="w-2 h-2 bg-accent rounded-full"></div>
                ))}
              </div>
            </div>
          </div>
        </motion.div>

        {/* Skills */}
        <div className="mb-16">
          <motion.h3
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            className="text-xl mb-6"
          >
            <span className="hash-tag">#</span>skills
          </motion.h3>
          
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {Object.entries(skills).map(([category, skillList]) => (
              <SkillCategory key={category} title={category} skills={skillList} />
            ))}
          </div>
        </div>

        {/* Fun Facts */}
        <div>
          <motion.h3
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true }}
            className="text-xl mb-6"
          >
            <span className="hash-tag">#</span>my-fun-facts
          </motion.h3>
          
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {funFacts.map((fact, index) => (
              <FunFact key={index}>{fact}</FunFact>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
